import React, { Component } from 'react';
import './App.css';
import Header from "./components/Header";

class App extends Component {
  state = {
    currentScore: 0,
    topScore: 0,
    message: ""
  }
  render() {
    return (
      <div className="container">
        <Header />
        <div>Game Board</div>
      </div>
    );
  }
}

export default App;
